/* Packages */
import React from 'react';

/* Component */
class Button extends React.Component {
    render() {
        return (
            <button {...this.props}
                    className={`aph btn ${this.props.className || ''}`}>
                {this.props.children}
            </button>
        );
    }
}

/* Default Properties */
Button.defaultProps = {
    type: 'button',
};

export default Button;
